OWIN/Katana Middleware to enforce SSL using configurable port and httpstatuscode

app.UseRedirectMiddleware(new RedirectOptions() { Port = 44300, StatusCode = 302 });

// default to port 443, statuscode 301
app.UseRedirectMiddlewareDefaultSettings();

SPGenarator Generate CRUD Stored Procedure From Table In Sql Server.
For More Info Please Visit:
https://github.com/AlirezaP/SPGenerator.

Sample:

using (SqlHelper ado = new SqlHelper(@"Connection String"))
{
string tb = ado.GetTableName().FirstOrDefault();
var obj = ado.GetRecordInfo(tb);

Generator gn = new Generator(tb, obj.ToArray());

var InsertScript = gn.CreateIns();
var SelectScript = gn.CreateList();
var DeleteScript = gn.CreateDel();
var UpdateScript = gn.CreateUpd();
}
